import React from 'react';
import { Container,
  Typography } from '@material-ui/core';
import { Wifi as WifiIcon } from '@material-ui/icons';

import ThreatMap from './ThreatMap';

function NetworkProtectionContainer(){
  return(
    <Container>
      <div style={{textAlign: 'center'}}>
        <WifiIcon style={{fontSize: '5em', color: 'green'}}/>
        <Typography>Current network is safe</Typography>
      </div>
      <Typography>Lookout detects attacks that attempt to steal your personal or sensitive company data over Wi-Fi or cellular networks.</Typography>
      <ThreatMap />
    </Container>
  );
};

export default NetworkProtectionContainer;
